import React, { Component } from "react";
import { Map, GoogleApiWrapper, Marker } from "google-maps-react";
const styles = {
  mapStyles: {
    width: "96%"
  },
  mapContainer: {
    width: "50%",
    height: "26em"
  }
};
class RealMap extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    let actPos = { lat: this.props.lat, lng: this.props.lon };
    console.log(actPos);
    return (
      <div style={styles.mapContainer}>
        <Map
          google={this.props.google}
          zoom={8}
          style={styles.mapStyles}
          initialCenter={actPos}
        >
          <Marker position={actPos} />
        </Map>
      </div>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: "AIzaSyDqV0nn953l7QAY_1GKVKcQO6Md2YW2W1o"
})(RealMap);
